var portNumber = process.platform == "linux" ? 5323 : 1e3;
var ConnectorSingleton = class {
  constructor() {
    this._platform = process.platform;
    this._platformMap = {
      win32: "WINDOWS" /* Windows */,
      darwin: "MACOS" /* Macos */,
      linux: "LINUX" /* Linux */
    };
    this.parameters = {
      basePath: `http://localhost:${portNumber}`,
      fetchApi: fetch
    };
    this.configuration = new Configuration(this.parameters);
    this.api = new ConnectorApi(this.configuration);
    this.searchApi = new SearchApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.allocationsApi = new AllocationsApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.applicationApi = new ApplicationApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.linkifyApi = new LinkifyApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.assetsApi = new AssetsApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.formatApi = new FormatApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.userApi = new UserApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.osApi = new OSApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.assetApi = new AssetApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.DiscoveryApi = new DiscoveryApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.wellKnownApi = new WellKnownApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.QGPTApi = new QGPTApi(
      new Configuration2({ fetchApi: fetch, basePath: this.parameters.basePath })
    );
    this.application = {
      name: "OBSIDIAN" /* Obsidian */,
      version,
      platform: this._platformMap[this._platform] || "UNKNOWN" /* Unknown */
    };
    this.seeded = {
      application: this.application
    };
  }
  static getInstance() {
    if (!ConnectorSingleton.instance) {
      ConnectorSingleton.instance = new ConnectorSingleton();
    }
    return ConnectorSingleton.instance;
  }
  static async checkConnection({
    notification = true
  }) {
    try {
      await fetch(`http://localhost:${portNumber}/.well-known/health`);
      return true;
    } catch (e) {
      const notifications7 = Notifications.getInstance();
      if (notification) {
        notifications7.information({
          message: Constants.CORE_PLATFORM_MSG
        });
      }
      return false;
    }
  }
  async track(event) {
    const { context, api } = this;
    if (!context) {
      throw new Error("Application context could not be found when calling");
    }
    const seededConnectorTracking = { ...event };
    const seed = {
      application: context.application.id,
      seededConnectorTracking
    };
    return api.track(seed).then((_) => true).catch((error) => {
      console.log(`Error from api.track Error: ${error}`);
      return false;
    });
  }
};

