// src/ui/utils/parseDescription.ts
var parseDescription = (input) => {
  if (!input) {
    return "";
  }
  const lines = input.split("\n");
  const firstMarker = "\u{1F4DD} Custom Description: ";
  const secondMarker = "\u{1F4A1} Smart Description: ";
  const thirdMarker = "\u{1F50E} Suggested Searches: ";
  const firstMarkerIndex = lines.findIndex((line) => line === firstMarker);
  const secondMarkerIndex = lines.findIndex((line) => line === secondMarker);
  if (firstMarkerIndex !== -1 && lines[firstMarkerIndex + 1] !== "Write a custom description here.") {
    return lines.slice(firstMarkerIndex + 1, secondMarkerIndex).join("\n");
  }
  if (secondMarkerIndex !== -1) {
    const thirdMarkerIndex = lines.findIndex((line) => line === thirdMarker);
    if (thirdMarkerIndex !== -1) {
      return lines.slice(secondMarkerIndex + 1, thirdMarkerIndex).join("\n");
    } else {
      return lines.slice(secondMarkerIndex + 1).join("\n");
    }
  }
  input = input.replace(firstMarker, "");
  input = input.replace(secondMarker, "");
  input = input.replace(thirdMarker, "");
  return input;
};

